clone-test5() = (truth-value {status}, text {status-text})
not-status, status : truth-value;
status-text: text = ""; 

FD: class fft-definition;

begin
   // just to check we are sane
   call validate-connection-colors-on-ws (the subworkspace of original-object4);

   create a fft-definition FD by cloning ORIGINAL-OBJECT4; 
   transfer FD to TEST-WS at (80, -1080);
   show the subworkspace of FD;
   
   not-status = call validate-connection-colors-on-ws (the subworkspace of FD);
   status = not (not-status); 
   if status then status-text = "Some cloned connections on clone of the subworkspace of ORIGINAL-OBJECT4 have a wrong color";
   return status, status-text; 
end

validate-connection-colors-on-ws(ws : class kb-workspace) = ( truth-value )
obj, obj2 : class -angle;
conn : class -too-straight-in-connection-zoku;
sides : class symbol-list;
seq : sequence;
partial-success : truth-value ; 
// side : symbol;
begin
    for obj = each -angle upon ws do
        for conn = each -too-straight-in-connection-zoku connected to obj do
            create an symbol-list sides;
            for obj2 = each -angle connected to conn do
                insert connection-side (obj2,conn) at the end of sides;
            end;
            partial-success = call wtf(conn,sides);
            delete sides; 
            if not (partial-success) then 
                return false;
        end
    end;
return true;
end

{ check if color of the connection corresponds to its geometry }
wtf( conn : class connection, s : class symbol-list ) = (truth-value)
upper-p : truth-value = false;
lower-p : truth-value = false; 
color : symbol = the line-region stripe-color of conn; 
success : truth-value = false; 
begin
if the number of elements in s /= 2 then
    begin
    // If connection is connected to less than two objects it seem to be a stub
    // it is not interesting for us
    return true; 
    end;
if (the symbol right is a member of s) and (the symbol bottom is a member of s) then 
    lower-p = true
else if (the symbol left is a member of s) and (the symbol top is a member of s) then 
    upper-p = true
else
    begin
        post "Unable to detect geometry of some connection";
        return false;
    end;
if lower-p and color = the symbol white then success = true
else if upper-p and color = the symbol black then success = true;
return success; 
end
